from dataclasses import dataclass
from typing import TypedDict, Union

from stw_gen_sample3_api.basic_types import *
from stw_py_api_runtime.gen_classes.telemetry.parse import Message as _Message




@dataclass
class ErrorsI2C(_Message):

    # Внешняя ошибка
    bus: uint32_t
    # Бит ACK
    ack: uint32_t
    # Таймаут
    timeout: uint32_t
    # Арбитраж
    arbitration: uint32_t
    # DMA
    dma: uint32_t
    # DMA параметры
    dmaParam: uint32_t
    # Overrun/Underrun
    overrun: uint32_t


class ErrorsI2CDict(TypedDict):

    # Внешняя ошибка
    bus: Union[uint32_t, int ]

    # Бит ACK
    ack: Union[uint32_t, int ]

    # Таймаут
    timeout: Union[uint32_t, int ]

    # Арбитраж
    arbitration: Union[uint32_t, int ]

    # DMA
    dma: Union[uint32_t, int ]

    # DMA параметры
    dmaParam: Union[uint32_t, int ]

    # Overrun/Underrun
    overrun: Union[uint32_t, int ]

